  \ constraints and passes the example test cases. The output code needs to read from\
  \ and write to standard IO. Please wrap your code answer using ```:\nSergey Semyonovich\
  \ is a mayor of a county city N and he used to spend his days and nights in thoughts\
  \ of further improvements of Nkers' lives. Unfortunately for him, anything and everything\
  \ has been done already, and there are no more possible improvements he can think\
  \ of during the day (he now prefers to sleep at night). However, his assistants\
  \ have found a solution and they now draw an imaginary city on a paper sheet and\
  \ suggest the mayor can propose its improvements.\n\nRight now he has a map of some\
  \ imaginary city with n subway stations. Some stations are directly connected with\
  \ tunnels in such a way that the whole map is a tree (assistants were short on time\
  \ and enthusiasm). It means that there exists exactly one simple path between each\
  \ pair of station. We call a path simple if it uses each tunnel no more than once.\n\
  \nOne of Sergey Semyonovich's favorite quality objectives is the sum of all pairwise\
  \ distances between every pair of stations. The distance between two stations is\
  \ the minimum possible number of tunnels on a path between them.\n\nSergey Semyonovich\
  \ decided to add new tunnels to the subway map. In particular, he connected any\
  \ two stations u and v that were not connected with a direct tunnel but share a\
  \ common neighbor, i.e. there exists such a station w that the original map has\
  \ a tunnel between u and w and a tunnel between w and v. You are given a task to\
  \ compute the sum of pairwise distances between all pairs of stations in the new\
  \ map.\n\nInput\n\nThe first line of the input contains a single integer n (2 \u2264\
  \ n \u2264 200 000) \u2014 the number of subway stations in the imaginary city drawn\
  \ by mayor's assistants. Each of the following n - 1 lines contains two integers\
  \ u_i and v_i (1 \u2264 u_i, v_i \u2264 n, u_i \u2260 v_i), meaning the station\
  \ with these indices are connected with a direct tunnel.\n\nIt is guaranteed that\
  \ these n stations and n - 1 tunnels form a tree.\n\nOutput\n\nPrint one integer\
  \ that is equal to the sum of distances between all pairs of stations after Sergey\
  \ Semyonovich draws new tunnels between all pairs of stations that share a common\
  \ neighbor in the original map.\n\nExamples\n\nInput\n\n4\n1 2\n1 3\n1 4\n\n\nOutput\n\
  \n6\n\n\nInput\n\n4\n1 2\n2 3\n3 4\n\n\nOutput\n\n7\n\nNote\n\nIn the first sample,\
  \ in the new map all pairs of stations share a direct connection, so the sum of\
  \ distances is 6.\n\nIn the second sample, the new map has a direct tunnel between\
  \ all pairs of stations except for the pair (1, 4). For these two stations the distance\
  \ is 2.\nA: ```# by the authority of GOD   author: manhar singh sachdev #\n\nimport\
